import React from "react";
import { Switch, Route } from "react-router-dom";
import CarRent from "../Pages/CarRent/CarRent";
import Data from "../Data";

function Router() {
  return (
    <div>
      <Switch>
        <Route
          path="/CarRent/:id"
          render={(props) => <CarRent {...props} Data={Data} />}
        />
      </Switch>
    </div>
  );
}

export default Router;
